import React from 'react';
import './App.css';
import Nav from './Nav';
import Home from './pages/home/Home.js';
import Myslibros from './pages/myslibros/Myslibros';
import LeaguePlayerDetails from './pages/myslibros/LeaguePlayerDetails';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/Myslibros" exact component={Myslibros} />
          <Route path="/Myslibros/Player" component={LeaguePlayerDetails} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;

